import './App.css';
import LoginForm from './styles/style';
import FindPassword from "./styles/FindPassword";
import {BrowserRouter, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className='wrapper'>
      <div className='form_wrapper'>
        <h2> <a href='/'> Webstargram </a> </h2>

        <LoginForm />

        <BrowserRouter>
          <Routes>
            <Route path="/" element={<FindPassword />}> 비밀번호를 잊으셨나요? </Route>
            <Route path="/findpassword" element={<FindPassword />}> 비밀번호를 잊으셨나요? </Route>
          </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
